import React from 'react';
import "./header.css";


const Header = () => (
<div className="jumbotron jumbotron-fluid">
  <div className="container text-center">
    <h1 className="display-4">Looney Toons Memory</h1>
    <p className="lead">Click on the Toons to earn points. Click on them more than once and you lose!</p>
  </div>
</div>
);
export default Header;
